('5',NULL,'53','1033','1501033','Malta','মাল্টা',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'29','WEIGHT','1004','EB1004','123','123',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1','2','1',NULL,NULL,'2','2022-03-16 14:16:55','2','2022-04-13 17:51:19',NULL,'malta','0',NULL,NULL,'Malta - মাল্টা । Per Kg','Malta, মাল্টা,  Per Kg',NULL,NULL,NULL,'<p>Malta-মাল্টা ± 50 gm<br></p>',NULL,'<h4>The fruit is rich in mineral salts and other ingredients of nutritive value such as iron, lime, phosphorus, and vital minerals. Malta is loaded with vitamin C and vitamin B complex. It is a round-shaped, medium-sized fruit, weighting an average of 145.8 gm. It has a rough-surfaced orange ringed with a segment of around 9.67 centimetres and a sweet-tasting juice content of around 33.7 per cent. The fruit is often used to make processed juice, jam, jelly and etc.</h4><h5><b>Tips*: <span style=\"font-size: 1rem;\">The peel is used for face masks to reduce skin ailments.</span></b></h5>','<p>ফলটি খনিজ লবণ এবং পুষ্টিকর মূল্যের অন্যান্য উপাদান যেমন লোহা, চুন, ফসফরাস এবং গুরুত্বপূর্ণ খনিজগুলিতে সমৃদ্ধ। মাল্টা ভিটামিন সি এবং ভিটামিন বি কমপ্লেক্সে ভরপুর। এটি একটি বৃত্তাকার আকৃতির, মাঝারি আকারের ফল, যা গড়ে 145.8 গ্রাম ওজন করে।এটিতে প্রায় ৯.৬৭ সেন্টিমিটারের একটি অংশ এবং প্রায় ৩৩.৭ শতাংশের একটি মিষ্টি-স্বাদযুক্ত রস সামগ্রী সহ একটি রুক্ষ-উত্থিত কমলা রিং রয়েছে। ফলটি প্রায়শই প্রক্রিয়াজাত রস, জ্যাম, জেলি ইত্যাদি তৈরি করতে ব্যবহৃত হয়।</p><p>টিপস *: ত্বকের অসুস্থতা কমাতে মুখের মাস্কের জন্য খোসা ব্যবহার করা হয়।<br></p>'),
