('31',NULL,'53','1044','1501044','Apple','আপেল',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'29','WEIGHT','1015','EB1015','275','275',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1','1','1',NULL,NULL,'2','2022-03-21 02:08:07',NULL,'2022-03-21 02:08:07',NULL,'apple','0',NULL,NULL,'Fruits - ফল |Apple-আপেল | 1kg','Fruits , ফল,Apple, আপেল ,1kg',NULL,NULL,NULL,'<p>Apple-আপেল<br></p>',NULL,'<p><span style=\"color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; font-size: 18px; letter-spacing: normal;\">Apples are among the world’s most popular fruits.</span></p><p><span style=\"color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; font-size: 18px; letter-spacing: normal;\">Apples are high in fiber, vitamin C, and various antioxidants. They are also very filling, considering their low calorie count. Studies show that eating apples can have multiple benefits for your health.</span></p><p><span style=\"color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; font-size: 18px; letter-spacing: normal;\">Usually eaten raw, apples can also be used in various recipes, juices, and drinks. Various types abound, with a variety of colors and sizes.</span><span style=\"color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; font-size: 18px; letter-spacing: normal;\"><br></span><span style=\"color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; font-size: 18px; letter-spacing: normal;\"><br></span><br></p>','<p>আপেল বিশ্বের সবচেয়ে জনপ্রিয় ফলগুলির মধ্যে একটি।</p><p><br></p><p>আপেলে প্রচুর পরিমাণে ফাইবার, ভিটামিন সি এবং বিভিন্ন অ্যান্টিঅক্সিডেন্ট থাকে। তারা তাদের কম ক্যালোরি গণনা বিবেচনা করে খুব ভরাট হয়। গবেষণায় দেখা গেছে যে আপেল খাওয়া আপনার স্বাস্থ্যের জন্য একাধিক সুবিধা হতে পারে।</p><p><br></p><p>সাধারণত কাঁচা খাওয়া হয়, আপেল বিভিন্ন রেসিপি, জুস এবং পানীয় ব্যবহার করা যেতে পারে। বিভিন্ন ধরণের প্রচুর পরিমাণে, বিভিন্ন রঙ এবং আকারের সাথে।</p>'),
