('34',NULL,'53','1047','1501047','Sapodilla (Sofeda)','সাপোডিলা (সোফেদা)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'29','WEIGHT','1018','EB1018','179','180',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1','1','1',NULL,NULL,'2','2022-03-21 14:26:10',NULL,'2022-03-21 14:26:10',NULL,'sapodilla-sofeda','0',NULL,NULL,'Fruits | Sapodilla (Sofeda) | সাপোডিলা (সোফেদা) | Per Kg','Fruits , Sapodilla, Sofeda, সোফেদা , Per Kg',NULL,NULL,NULL,'<p>Sapodilla (Sofeda)-সাপোডিলা (সোফেদা)<br></p>',NULL,'<p><span style=\"color: rgb(118, 118, 118); font-family: Roboto, Helvetica, sans-serif; letter-spacing: normal;\">Sapodilla</span><span style=\"color: rgb(102, 102, 102); font-family: Roboto, Helvetica, sans-serif; letter-spacing: normal;\">&nbsp;can be eaten fresh out of the skin or incorporated into recipes like sauces and baked goods.</span><br></p>','<p>সাপোডিলা ত্বক থেকে তাজা খাওয়া যেতে পারে বা সস এবং বেকড পণ্যগুলির মতো রেসিপিগুলিতে অন্তর্ভুক্ত করা যেতে পারে।<br></p>'),
('35',NULL,'53','1048','1501048','Banana (Bangla Kola)','কলা (বাংলা কলা)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'29','WEIGHT','1019','EB1019','123','123',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1','4','1',NULL,NULL,'2','2022-03-21 14:51:59','2','2022-04-13 18:07:21',NULL,'banana-bangla-kola','0',NULL,NULL,'Fruits - ফল | Banana (Bangla Kola) | কলা (বাংলা কলা)','Fruits ,ফল, Banana ,Bangla Kola , কলা ,বাংলা কলা',NULL,NULL,NULL,'<p>Banana (Bangla Kola)-কলা (বাংলা কলা)<br></p>',NULL,'<p>Bangla Kola is also known as Kabri , Bangla , Shail, Thutae and Manua. The fruits of this hardy tree are very sweet but sometimes contain seed. The peel is light yellow in color. </p>','<p>বাংলা কলা কবরী, বাংলা, শৈল, থুতাই এবং মনুয়া নামেও পরিচিত। এই শক্ত গাছের ফল খুব মিষ্টি হলেও মাঝে মাঝে বীজ থাকে। খোসা হালকা হলুদ রঙের হয়। <br></p>'),
('36',NULL,'53','1049','1501049','Amla (Amloki) ± 10gm','আমলা (আমলোকি) ± 10 গ্রাম',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'29','WEIGHT','1020','EB1020','69','70',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1','1','1',NULL,NULL,'2','2022-03-21 15:07:19',NULL,'2022-03-21 15:07:19',NULL,'amla-amloki-10gm','0',NULL,NULL,'Fruits - ফল | Amla (Amoliki) | 250gm ± 10gm','Fruits ,ফল, Amla ,Amoliki,  250gm , 10gm',NULL,NULL,NULL,'<p>Amla (Amoliki) ± 10gm<br></p>',NULL,'<p><span style=\"color: rgb(77, 77, 77); font-family: &quot;Proxima Nova&quot;, Helvetica, Arial, sans-serif; font-size: 18px; letter-spacing: normal;\">Amoloki&nbsp;</span><span style=\"color: rgb(77, 77, 77); font-family: &quot;Proxima Nova&quot;, Helvetica, Arial, sans-serif; font-size: 18px; letter-spacing: normal;\">, also known as amla, is a potent rejuvenating herbal adaptogen, renowned for its impressive list of health benefits and all-encompassing support. A longtime go-to herb for its many benefits, it has been used in Ayurveda and other Asian medicinal practices for thousands of years.</span><br></p>','<p>Amoloki, এছাড়াও আমলা হিসাবে পরিচিত, একটি শক্তিশালী পুনরুজ্জীবিত ভেষজ adaptogen, স্বাস্থ্য বেনিফিট এবং সর্বব্যাপী সমর্থন তার চিত্তাকর্ষক তালিকা জন্য বিখ্যাত। তার অনেক সুবিধার জন্য একটি দীর্ঘকালীন গো-টু-ভেষজ, এটি হাজার হাজার বছর ধরে আয়ুর্বেদ এবং অন্যান্য এশীয় ঔষধি অনুশীলনে ব্যবহৃত হয়েছে।<br></p>'),
('37',NULL,'53','1078','1501078','Sour Jujube (Tok Boroi)','টক জুজুবে (টক বোরোই)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'29','Weight','1021','EB1021','59','60',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1','2','1',NULL,NULL,'2','2022-03-21 15:18:01','2','2022-06-16 17:33:08',NULL,'sour-jujube-tok-boroi','0',NULL,NULL,'Fruits - ফল | Sour Jujube (Tok Boroi) | টক বোরোই | 500gm','Fruits , ফল , Sour Jujube, Tok Boroi ,টক বোরোই  , 500gm, Boroi , বোরোই',NULL,NULL,NULL,'<p>Sour Jujube (Tok Boroi)<br></p>',NULL,'<p><span style=\"color: rgb(102, 102, 102); font-family: Roboto, Helvetica, sans-serif; letter-spacing: normal;\">In Bangladesh one of the most popular seasonal fruit is</span><span style=\"color: rgb(118, 118, 118); font-family: Roboto, Helvetica, sans-serif; letter-spacing: normal;\"> Jujube, in Bangla</span><span style=\"color: rgb(102, 102, 102); font-family: Roboto, Helvetica, sans-serif; letter-spacing: normal;\"> people call it as</span><span style=\"color: rgb(118, 118, 118); font-family: Roboto, Helvetica, sans-serif; letter-spacing: normal;\"> Boroi</span><span style=\"color: rgb(102, 102, 102); font-family: Roboto, Helvetica, sans-serif; letter-spacing: normal;\"> or Kul.It is also known as Indian</span><span style=\"color: rgb(118, 118, 118); font-family: Roboto, Helvetica, sans-serif; letter-spacing: normal;\"> jujube.</span><br></p>',NULL),
('38',NULL,'53','1051','1501051','Dragon Fruit ± 20 gm','ড্রাগন ফল ± 20 গ্রাম',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'29','WEIGHT','1022','EB1022','910','910',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1','1','1',NULL,NULL,'2','2022-03-21 15:29:41',NULL,'2022-03-21 15:29:41',NULL,'dragon-fruit-20-gm','0',NULL,NULL,'Fruits -ফল | Dragon Fruit -ড্রাগন ফল | Per kg  ± 20 gm','Fruits ,ফল , Dragon Fruit , ড্রাগন ফল , Per kg',NULL,NULL,NULL,'<p>Dragon Fruit ± 20 gm<br></p>',NULL,'<h4 style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">Dragon fruit is a tropical fruit that has become increasingly popular in recent years.<br>Though people primarily enjoy it for its unique look and taste, evidence suggests it may provide health benefits as well.</h4>','<p>ড্রাগন ফল একটি ক্রান্তীয় ফল যা সাম্প্রতিক বছরগুলিতে ক্রমবর্ধমান জনপ্রিয় হয়ে উঠেছে।</p><p>যদিও লোকেরা প্রাথমিকভাবে এটির অনন্য চেহারা এবং স্বাদের জন্য এটি উপভোগ করে, তবে প্রমাণগুলি পরামর্শ দেয় যে এটি স্বাস্থ্য সুবিধাও সরবরাহ করতে পারে।</p>'),
