('40',NULL,'53','1053','1501053','Ajwa Dates (Sealed)','আজওয়া খেজুর (সিল করা)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'29','WEIGHT','1024','EB1024','269','270',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1','1','1',NULL,NULL,'2','2022-03-21 17:39:20',NULL,'2022-03-21 17:39:20',NULL,'ajwa-dates-sealed','0',NULL,NULL,'Fruits | Ajwa Dates-আজওয়া খেজুর | 250gm','Fruits , ফল , Ajwa Dates,আজওয়া খেজুর, 250gm, Ajwa , Dates',NULL,NULL,NULL,NULL,NULL,'<p><span style=\"color: rgb(17, 17, 17); font-family: Roboto, sans-serif; font-size: 18px; letter-spacing: normal;\">Ajwa dates are a good source of the mineral potassium</span><span style=\"color: rgb(17, 17, 17); font-family: Roboto, sans-serif; font-size: 18px; letter-spacing: normal;\">. This essential mineral is necessary for the maintenance of muscle contractions in the body. Individuals with constipation and other digestive problems may benefit from consuming Ajwa dates.</span><br></p>','<p>আজওয়া খেজুর খনিজ পটাসিয়ামের একটি ভাল উৎস। শরীরের পেশী সংকোচনের রক্ষণাবেক্ষণের জন্য এই অপরিহার্য খনিজটি প্রয়োজনীয়। কোষ্ঠকাঠিন্য এবং অন্যান্য হজমের সমস্যাযুক্ত ব্যক্তিরা জোয়া খেজুর খাওয়ার ফলে উপকৃত হতে পারেন।<br></p>'),
('45',NULL,'53','1054','1501054','Elephant Apple (Chalta)','চালতা',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'29','WEIGHT','1025','EB1025','35','35',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1','1','1',NULL,NULL,'2','2022-03-21 17:51:48',NULL,'2022-03-21 17:51:48',NULL,'elephant-apple-chalta','0',NULL,NULL,'Fruits |Elephant Apple (Chalta) | চালতা  | Each','Fruits,Elephant Apple, Chalta , চালতা  , Each , apple , chalta',NULL,NULL,NULL,'<p>Elephant Apple (Chalta)<br></p>',NULL,'<p>Chalta is an eternally green shrub, with the trees often grow up to a height of 15 m. The reddish-brown barks hold strong branches with broad serrated leaves. The flowers bloom in summer, being bright white with many petals and sprout into the tangy chalta fruit in colder climates.</p><p><br></p><p>An expansive array of useful plant constituents are present in chalta fruits, making them a prominent source of vital nutrients. They are inherently rich in vitamin C, vitamin B complex, vitamin E, potassium, healthy fats, amino acids and proteins, besides being low in cholesterol. Moreover, chalta abounds in beneficial phytochemicals namely tannins, saponins, flavonoids, triterpenoids and phenolics, which supply powerful anticancer, antibacterial and antioxidant characteristics.</p>',NULL),
('46',NULL,'53','1055','1501055','Wood Apple( Bel )','বেল',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'29','WEIGHT','1026','EB1026','79','80',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1','1','1',NULL,NULL,'2','2022-03-21 17:57:47',NULL,'2022-03-21 17:57:47',NULL,'wood-apple-bel','0',NULL,NULL,'Fruits | Wood Apple (Bel) | বেল  | Each','Fruits, ফল  , Wood Apple, Bel , বেল  , Each pcs',NULL,NULL,NULL,'<p>Wood Apple( Bel ) - বেল<br></p>',NULL,'<h4><span style=\"color: rgb(68, 68, 68); font-family: &quot;Open Sans&quot;; font-size: 20px; letter-spacing: normal;\">The Wood Apple is found through Southeastern Asia and it has several uses in the kitchen. Many people like to work the Wood Apple down in order to turn it into a sweet and slightly tart jam. You can also use the fruit in certain popular drinks such as the Bela Pana which combines water, sugar, citron juice, and of course the Wood Apple to finish things off.</span></h4>','<p>কাঠঅ্যাপল দক্ষিণ-পূর্ব এশিয়ার মধ্য দিয়ে পাওয়া যায় এবং রান্নাঘরে এর বেশ কয়েকটি ব্যবহার রয়েছে। অনেক লোক কাঠের আপেলটি একটি মিষ্টি এবং সামান্য টার্ট জ্যামে পরিণত করার জন্য নিচে কাজ করতে পছন্দ করে। আপনি কিছু জনপ্রিয় পানীয় যেমন বেলা পানা তে ফলটি ব্যবহার করতে পারেন যা জল, চিনি, সিট্রন রস এবং অবশ্যই কাঠের আপেলকে একত্রিত করে জিনিসগুলি শেষ করার জন্য।<br></p>'),
('48',NULL,'53','1056','1501056','Watermelon (Tormuj)','তোরমুজ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'29','WEIGHT','1027','EB1027','370','370',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1','1','1',NULL,NULL,'2','2022-03-21 18:25:56',NULL,'2022-03-21 18:25:56',NULL,'watermelon-tormuj','0',NULL,NULL,'Fruits | Watermelon (Tormuj)-তরমুজ  | Per pcs','Fruits ,Watermelon, Tormuj, তরমুজ  , Per pcs, ফল',NULL,NULL,NULL,'<p>Watermelon (Tormuj)-তরমুজ&nbsp;<br></p>',NULL,'<p>Watermelon is packed with water and nutrients, contains very few calories, and is exceptionally refreshing.<br></p>','<p>তরমুজ জল এবং পুষ্টিতে ভরপুর, এতে খুব কম ক্যালোরি থাকে এবং এটি ব্যতিক্রমীভাবে রিফ্রেশিং হয়।<br></p>'),
('49',NULL,'53','1057','1501057','Watermelon (Tormuj) - Black','তরমুজ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'29','WEIGHT','1028','EB1028','369','369',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1','1','1',NULL,NULL,'2','2022-03-21 18:48:03',NULL,'2022-03-21 18:48:03',NULL,'watermelon-tormuj-black','0',NULL,NULL,'Fruits | Watermelon (Tormuj) | Black Diamond  | Per pcs','Fruits , Watermelon ,Tormuj ,Black Diamond  , Per pcs, তরমুজ',NULL,NULL,NULL,'<p>Watermelon (Tormuj) - Black Diamond&nbsp;<br></p>',NULL,'<p><span style=\"font-family: &quot;Trebuchet MS&quot;; font-size: small; letter-spacing: normal;\">Black Diamond Watermelon is sometimes described as the \'king\' of the garden, sometimes weighing 50 pounds or more. The bright red flesh is noted for its juiciness and sweet taste. Expect approximately 3 months of growth after germination before melons are ready for harvest. Black Diamond is the quintessential watermelon of summer, and is equally popular with both home and commercial growers.</span><br></p>','<p>কালো হীরক তরমুজকে কখনও বাগানের \'রাজা\' হিসাবে বর্ণনা করা হয়, কখনও কখনও 50 পাউন্ড বা তার বেশি ওজনের। উজ্জ্বল লাল মাংস তার রসালোতা এবং মিষ্টি স্বাদের জন্য বিখ্যাত। তরমুজ ফসল কাটার জন্য প্রস্তুত হওয়ার আগে অঙ্কুরোদগমের পরে প্রায় 3 মাসের বৃদ্ধির আশা করুন। ব্ল্যাক ডায়মন্ড হল গ্রীষ্মের সর্বোত্তম তরমুজ, এবং এটি বাড়ি এবং বাণিজ্যিক উভয় উৎপাদকদের কাছে সমানভাবে জনপ্রিয়।<br></p>'),
('50',NULL,'53','1058','1501058','Rambutan Fruit','রাম্বুটান ফল',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'29','WEIGHT','1029','EB1029','529','529',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1','1','1',NULL,NULL,'2','2022-03-21 19:04:16',NULL,'2022-03-21 19:04:16',NULL,'rambutan-fruit','0',NULL,NULL,'Fruits | Rambutan Fruit | 500gm','Fruits ,Rambutan Fruit , 500gm,ফল',NULL,NULL,NULL,'<p>Rambutan Fruit<br></p>',NULL,'<h4 style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">The rambutan fruit is rich in many vitamins, minerals and beneficial plant compounds.<br>Its flesh provides around 1.3–2 grams of total fiber per 3.5 ounces (100 grams) — similar to what you would find in the same quantity of apples, oranges or pears.<hl-trusted-source source=\"PubMed Central\" rationale=\"Highly respected database from the National Institutes of Health\" class=\"css-12hs4c5\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; display: inline;\"><a href=\"https://www.ncbi.nlm.nih.gov/pubmed/15539312\" target=\"_blank\" rel=\"noopener noreferrer\" class=\"content-link css-5r4717\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; cursor: pointer; border-color: currentcolor; color: rgb(2, 131, 141);\"><span class=\"css-1mdvjzu icon-hl-trusted-source-after\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; cursor: pointer; border-color: currentcolor; color: rgb(2, 131, 141);\"><span class=\"sro\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; position: absolute; left: -10000px; top: auto; width: 1px; height: 1px; overflow: hidden;\">Trusted Source</span></span></a></hl-trusted-source>It’s also rich in vitamin C, a nutrient that helps your body absorb dietary iron more easily. This vitamin also acts as an antioxidant, protecting your body’s cells against damage. Eating 5–6 rambutan fruit will meet 50% of your daily vitamin C needs.<br>Rambutan also contains a good amount of&nbsp;copper, which plays a role in the proper growth and maintenance of various cells, including those of your bones, brain and heart.</h4>','<p>র ্যামবুটান ফল অনেক ভিটামিন, খনিজ এবং উপকারী উদ্ভিদ যৌগ সমৃদ্ধ।</p><p>এর মাংস প্রতি 3.5 আউন্স (100 গ্রাম) প্রতি প্রায় 1.3-2 গ্রাম মোট ফাইবার সরবরাহ করে - আপনি একই পরিমাণে আপেল, কমলা বা নাশপাতিগুলিতে যা পাবেন তার অনুরূপ। এটি ভিটামিন সি সমৃদ্ধ, এটি এমন একটি পুষ্টি যা আপনার শরীরকে আরও সহজে খাদ্যতালিকাগত আয়রন শোষণ করতে সহায়তা করে। এই ভিটামিনটি অ্যান্টিঅক্সিডেন্ট হিসাবেও কাজ করে, যা আপনার দেহের কোষগুলিকে ক্ষতির হাত থেকে রক্ষা করে।&nbsp;5-6 রামবুটান ফল খাওয়া আপনার প্রতিদিনের ভিটামিন সি চাহিদার 50% পূরণ করবে।</p><p>রামবুতানে প্রচুর পরিমাণে তামাও রয়েছে, যা আপনার হাড়, মস্তিষ্ক এবং হৃদয় সহ বিভিন্ন কোষের সঠিক বৃদ্ধি এবং রক্ষণাবেক্ষণে ভূমিকা পালন করে।</p><div><br></div>'),
