('57',NULL,'54','1032','1511032','Cauliflower (Fulkopi)','ফুলকপি',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'29','WEIGHT','1036','EB1036','69','70',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1','1','1',NULL,NULL,'2','2022-03-22 13:51:03',NULL,'2022-03-22 13:51:03',NULL,'cauliflower-fulkopi','0',NULL,NULL,'Vegetable| সবজি | Cauliflower (Fulkopi) | ফুলকপি | Per pcs','Vegetable, সবজি , Cauliflower ,Fulkopi,ফুলকপি , Per pcs',NULL,NULL,NULL,'<p>Cauliflower (Fulkopi) -&nbsp;ফুলকপি<br></p>',NULL,'<div><font color=\"#313131\" face=\"Source Sans Pro, Verdana, sans-serif\"><span style=\"font-size: 18px; letter-spacing: -0.273104px;\">Cauliflower is both a vegetable and a fruit. Cauliflower\'s head or curd is a popular cuisine item.</span></font></div><div><font color=\"#313131\" face=\"Source Sans Pro, Verdana, sans-serif\"><span style=\"font-size: 18px; letter-spacing: -0.273104px;\"><br></span></font></div><div><font color=\"#313131\" face=\"Source Sans Pro, Verdana, sans-serif\"><span style=\"font-size: 18px; letter-spacing: -0.273104px;\">Benefits:&nbsp;</span></font></div><div><font color=\"#313131\" face=\"Source Sans Pro, Verdana, sans-serif\"><span style=\"font-size: 18px; letter-spacing: -0.273104px;\">Obesity, heart disease, diabetes, cancer, and other illnesses are all treated with cauliflower, however there is no scientific proof to back up these claims.</span></font></div><div><span style=\"color: rgb(49, 49, 49); font-family: &quot;Source Sans Pro&quot;, Verdana, sans-serif; font-size: 18px; letter-spacing: -0.273104px;\">&nbsp;It\'s also utilized for medical purposes.</span><font color=\"#313131\" face=\"Source Sans Pro, Verdana, sans-serif\"><span style=\"font-size: 18px; letter-spacing: -0.273104px;\"><br></span></font></div>','<p>ফুলকপি একটি উদ্ভিজ্জ এবং একটি ফল উভয়ই। ফুলকপির মাথা বা দই একটি জনপ্রিয় রন্ধনপ্রণালীর আইটেম।</p><p><br></p><p>বেনিফিট:&nbsp;</p><p>স্থূলতা, হৃদরোগ, ডায়াবেটিস, ক্যান্সার এবং অন্যান্য অসুস্থতাগুলি ফুলকপি দিয়ে চিকিত্সা করা হয়, তবে এই দাবিগুলির ব্যাক আপ করার জন্য কোনও বৈজ্ঞানিক প্রমাণ নেই।</p><p>&nbsp;এটি চিকিৎসার কাজেও ব্যবহৃত হয়।</p>'),
