('362',NULL,'53','1066','1501066','Lal Angur (Red Grapes) ± 12 gm','লাল আঙ্গুর (লাল আঙ্গুর) ± 12 গ্রাম',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'29','Weight','1304','EB1304','179','179',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1','1','1',NULL,NULL,'2','2022-05-26 13:30:30',NULL,'2022-05-26 13:30:30',NULL,'lal-angur-red-grapes-12-gm','0','Lal Angur',NULL,'Lal Angur (Red Grapes) ± 12 gm','Lal Angur (Red Grapes)','Lal Angur (Red Grapes) ± 12 gm',NULL,NULL,'<p>লাল আঙ্গুর<br></p>',NULL,'<p><span style=\"color: rgb(51, 51, 51); font-family: &quot;segoe ui&quot;, Helvetica, &quot;droid sans&quot;, Arial, &quot;lucida grande&quot;, tahoma, verdana, arial, sans-serif; letter-spacing: normal;\">The combination of unique texture and sweet, tart flavor has made Red Grapes an extra-ordinary fruit. Red Grapes are small round or oval berries that feature semi-translucent flesh encased by a smooth skin. Red grapes are relatively low in calories and are fat and cholesterol free. A 1-cup serving of red grapes contains only 104 calories, yet still provides 1 g of protein and 1 g of fiber. However, this serving also contains 27 g of total carbohydrates, 23 g of which come from sugar. Red grapes are a good source of several vitamins. One serving of red grapes offers 16 mg of vitamin C, which is about 27 percent of the daily value, based on a 2,000-calorie diet. It also contains 22 mcg of vitamin K and 0.4 mg of thiamin, which is about 28 percent and 27 percent of the daily value, respectfully. Red grapes also contain small amounts of vitamin E, vitamin A, vitamin K, pantothenic acid, vitamin B-6, folate, beta carotene and alpha carotene. These nutrients help your body processes function properly.</span><br></p>',NULL),
('363',NULL,'53','1067','1501067','Narikel (Coconut)','নারিকেল',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'29','Weight','1305','EB1305','99','99',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1','1','1',NULL,NULL,'2','2022-05-26 13:34:05',NULL,'2022-05-26 13:34:05',NULL,'narikel-coconut','0','Narikel',NULL,'Narikel (Coconut)','Narikel (Coconut)','Narikel (Coconut)',NULL,NULL,'<p>নারিকেল&nbsp;<br></p>',NULL,'<p><span style=\"color: rgb(51, 51, 51); font-family: &quot;segoe ui&quot;, Helvetica, &quot;droid sans&quot;, Arial, &quot;lucida grande&quot;, tahoma, verdana, arial, sans-serif; letter-spacing: normal;\">Coconut is one of very versatile and indispensable food item for millions of inhabitants in South and South-East Asia. It is one of the most sought-after ingredients in the kitchen since it employed in almost each and every recipe prepared in these parts of the world. Coconut is a very versatile and indispensable food item for most people under the tropical belt. It is a complete food rich in calories, vitamins, and minerals. A medium-size coconut carrying 400 g edible meat and some 30-150 ml of water may provide almost all the daily-required essential minerals, vitamins, and energy of an average-sized individual. Coconut water is a very refreshing drink to beat tropical summer thirst. The juice is packed with simple sugar, electrolytes, minerals, and bioactive compounds such as cytokinin, and enzymes such as acid phosphatase, catalase, dehydrogenase, peroxidase, polymerases, etc. Altogether, these enzymes aid in digestion and metabolism. It is also a very good source of B-complex vitamins such as folates, riboflavin, niacin, thiamin, and pyridoxine. These vitamins are essential in the sense that body requires them from external sources to replenish. Coconut meat and water contain a very good amount of potassium. 100 g of fresh meat contains 356 mg% or 7.5% of daily required levels of potassium. A full-sized coconut weighs about 1.44 kg (3.2 lb).</span><br></p>',NULL),
