('366',NULL,'53','1070','1501070','Malta (Special Offer) ± 50 gm','মাল্টা (বিশেষ অফার) ± 50 গ্রাম',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'29','Weight','1308','EB1308','359','329',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1','1','1',NULL,NULL,'2','2022-05-26 13:47:20',NULL,'2022-05-26 13:47:20',NULL,'malta-special-offer-50-gm','0','Malta',NULL,'Malta (Special Offer) ± 50 gm','Malta (Special Offer','Malta (Special Offer) ± 50 gm',NULL,NULL,'<p>মাল্টা (বিশেষ অফার)<br></p>',NULL,'<p><span style=\"color: rgb(51, 51, 51); font-family: &quot;segoe ui&quot;, Helvetica, &quot;droid sans&quot;, Arial, &quot;lucida grande&quot;, tahoma, verdana, arial, sans-serif; letter-spacing: normal;\">Malta, a variety of orange, is a popular citrus fruit cultivated in hot climate. The fruit is rich in mineral salts and other ingredients of nutritive value such as iron, lime, phosphorus, and vital minerals. Malta is loaded with vitamin C and vitamin B complex. It is a round-shaped, medium-sized fruit, weighting an average of 145.8 gm. It has a rough-surfaced orange ringed with a segment of around 9.67 centimetres and a sweet-tasting juice content of around 33.7 per cent. The fruit is often used to make processed juice, jam, jelly and marmalade.</span><br></p>',NULL),
