('42','45','11','54f5sd4f5sd4f2121','150102211','EB102511','11','elephant-apple-chalta-per-pcs','Elephant Apple (Chalta)-per pcs','চালতা-প্রতি পিসি',NULL,'29','Weight','56','per pcs',NULL,NULL,NULL,NULL,'2','0',NULL,NULL,NULL,'29','0','29','29','1','0',NULL,'<p>Chalta is an eternally green shrub, with the trees often grow up to a height of 15 m. The reddish-brown barks hold strong branches with broad serrated leaves. The flowers bloom in summer, being bright white with many petals and sprout into the tangy chalta fruit in colder climates.</p><p><br></p><p>An expansive array of useful plant constituents are present in chalta fruits, making them a prominent source of vital nutrients. They are inherently rich in vitamin C, vitamin B complex, vitamin E, potassium, healthy fats, amino acids and proteins, besides being low in cholesterol. Moreover, chalta abounds in beneficial phytochemicals namely tannins, saponins, flavonoids, triterpenoids and phenolics, which supply powerful anticancer, antibacterial and antioxidant characteristics.</p>',NULL,'Elephant Apple (Chalta)-per pcs',NULL,'Elephant Apple (Chalta)-per pcs  per pcs  Fresh Fruits EB102511  Chalta is an eternally green shrub, with the trees often grow up to a height of 15 m. The reddish-brown barks hold strong branches with broad serrated leaves. The flowers bloom in summer, being bright white with many petals and sprout into the tangy chalta fruit in colder climates.     An expansive array of useful plant constituents are present in chalta fruits, making them a prominent source of vital nutrients. They are inherently rich in vitamin C, vitamin B complex, vitamin E, potassium, healthy fats, amino acids and proteins, besides being low in cholesterol. Moreover, chalta abounds in beneficial phytochemicals namely tannins, saponins, flavonoids, triterpenoids and phenolics, which supply powerful anticancer, antibacterial and antioxidant characteristics. ',NULL,'Fruits |Elephant Apple (Chalta) | চালতা  | Each','Fruits,E