('596','24','12','150107712','150107712','EB101112','12','pomegranate-dalim-12-pcs','Pomegranate (Dalim)-12 pcs','ডালিম-12 পিসি',NULL,'29','Weight','54','12 pcs',NULL,NULL,NULL,NULL,NULL,'0',NULL,NULL,NULL,'700','0','700','700',NULL,NULL,NULL,'<p><span style=\"color: rgb(118, 118, 118); font-family: Roboto, Helvetica, sans-serif; letter-spacing: normal;\">Pomegranate</span><span style=\"color: rgb(102, 102, 102); font-family: Roboto, Helvetica, sans-serif; letter-spacing: normal;\"> fruit is one of the most popular, nutritionally rich fruit with unique flavor, taste, and health promoting characteristics. </span></p><p><span style=\"font-size: 1rem; color: rgb(32, 33, 34); font-family: sans-serif;\">Red-purple in color, the pomegranate fruit husk </span><span style=\"font-size: 1rem; color: rgb(32, 33, 34); font-family: sans-serif;\">has two parts: an outer, hard</span> pericarp<span style=\"box-sizing: border-box; font-size: 1rem; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: 0.5px; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; color: rgb(32, 33, 34); font-family: sans-serif;\"> </span>pericarp<span style=\"font-size: 1rem; color: rgb(32, 33, 34); font-family: sans-serif;\">, and an inner, spongy </span><span style=\"font-size: 1rem; color: rgb(32, 33, 34); font-family: sans-serif;\">mesocarp (white \"albedo\"), which comprises the fruit inner wall where seeds attach.</span><span style=\"font-size: 1rem; color: rgb(32, 33, 34); font-family: sans-serif;\">Membrane</span>s of the mesocarp are organized as nonsymmetric chambers that contain seeds inside sarcotestas, which are embedded without attachment to the mesocarp. Containing juice, the sarcotestas is formed as a thin membrane derived from the epidermal cells of the seeds. The number of seeds in a pomegranate can vary from 200 to about 1,400.</p>','<p>ডালিম ফল অনন্য স্বাদ, স্বাদ, এবং স্বাস্থ্য প্রচারের বৈশিষ্ট্যগুলির সাথে সবচেয়ে জনপ্রিয়, পুষ্টিকরভাবে সমৃদ্ধ ফলগুলির মধ্যে একটি।</p><p>লাল-বেগুনি রঙের, ডালিম ফলের ভুষির দুটি অংশ রয়েছে: একটি বাহ্যিক, হার্ড পেরিকার্প পেরিকার্প, এবং একটি অভ্যন্তরীণ, স্পঞ্জি মেসোকার্প (সাদা \"অ্যালবেডো\"), যা ফলের অভ্যন্তরের প্রাচীর নিয়ে গঠিত যেখানে বীজ সংযুক্ত থাকে।মেসোকার্পের ঝিল্লিগুলি ননসিমেট্রিক চেম্বার হিসাবে সংগঠিত হয় যা সারকোটেস্টাসের অভ্যন্তরে বীজ ধারণ করে, যা মেসোকার্পের সাথে সংযুক্তি ছাড়াই এম্বেড করা হয়। রস ধারণকারী, সারকোটেস্টাস বীজের এপিডার্মাল কোষ থেকে প্রাপ্ত একটি পাতলা ঝিল্লি হিসাবে গঠিত হয়। ডালিমে বীজের সংখ্যা ২০০ থেকে প্রায় ১,৪০০ পর্যন্ত হতে পারে।<br></p>','<p>Pomegranate (Dalim)-ডালিম <br></p>',NULL,'Pomegranate (Dalim)-12 pcs  12 pcs  Fresh Fruits EB101112   Pomegranate   fruit is one of the most popular, nutritionally rich fruit with unique flavor, taste, and health promoting characteristics.     Red-purple in color, the pomegranate fruit husk   has two parts: an outer, hard  pericarp   pericarp , and an inner, spongy   mesocarp (white \"albedo\"), which comprises the fruit inner wall where seeds attach.  Membrane s of the mesocarp are organized as nonsymmetric chambers that contain seeds inside sarcotestas, which are embedded without attachment to the mesocarp. Containing juice, the sarcotestas is formed as a thin membrane derived from the epidermal cells of the seeds. The number of seeds in a pomegranate can vary from 200 to about 1,400. ',NULL,'Fruits - ফল | Pomegranate (Dalim) | ডালিম - 2 Pcs','Fruits , ফল |, Pomegranate , Dalim , ডালিম,  2 Pcs',NULL,NULL,'1',NULL,NULL,'1',NULL,NULL,NULL,NULL,'0','2','2022-06-16 17:31:35',NULL,NULL,NULL),
