insert  into `WEB_DOCUMENTATION`(`PK_NO`,`DESCRIPTION`,`IS_ACTIVE`) values 
('1','<div class=\"grid-container\">\r\n    <nav id=\"navbar\">\r\n      </nav><span style=\"font-size: 14px;\">﻿</span><span style=\"font-size: 14px;\">﻿</span><span style=\"font-size: 14px;\">﻿</span><span style=\"font-size: 14px;\">﻿</span><span><div style=\"padding:10px;background-color:#f5f5f5;margin:10px 0 10px 15px;float:right;width:300px\"><h4 style=\"font-weight:bold\">HIGHLIGHTS</h4><ul style=\"padding-left:15px\"><li style=\"color:#000;margin-bottom:5px;font-size:15px;font-weight:400\">Write your highlight point</li></ul></div></span><nav id=\"navbar\"><header>Easybazar&nbsp; Documentation</header>\r\n      <a href=\"#Introduction\" class=\"nav-link\">Introduction</a>\r\n      <a href=\"#Loops_and_Iteration\" class=\"nav-link\">Loops and Iteration</a>\r\n      <a href=\"#Functions\" class=\"nav-link\">Functions</a>\r\n      <a href=\"#Regular_Expressions\" class=\"nav-link\">Regular Expressions</a>\r\n      <a href=\"#Objects\" class=\"nav-link\">Objects</a>\r\n    </nav>\r\n\r\n    <main id=\"main-doc\">\r\n      <section class=\"main-section\" id=\"Introduction\">\r\n<p><span style=\"font-size: 14px;\">﻿</span><span style=\"font-size: 14px;\">﻿</span></p><pre>function square(number) {<br>&nbsp; return number * number;<br>}</pre><p></p><p><span style=\"font-size: 14px;\"><br></span><br></p><p>BOOKING_STATUS FOR SLS_BOOKING_DETAILS</p><p>10 - Ordered,</p><p>20 - Cancel request</p><p>30 - Cancelled</p><p>50 - Confirmed</p><p>70 - Ready to Dispatch</p><p>80 - Dispatched/order picked by delivery man</p><p>85 - Shipped --order picked by delivery man</p><p>90 - Delivered</p><p>100 - Customer Acknowladged</p><p>110 - Customer Returned</p><p><br></p><p>&nbsp; IS_RETURN FOR SLS_BOOKING_DETAILS</p><p><br></p><p><br></p><p>&nbsp; NULL - nothing</p><p>&nbsp; 0 - Return Requested</p><p>&nbsp; 1 - Return Request Accepted</p><p>&nbsp; 2 - Partial Return</p><p><br></p><p><span style=\"font-size: 1rem;\">SLS_DELIVERY_HISTORY</span><br></p><p><br></p><p>0 - Not Delivered</p><p>10 - Delivered</p><p>20 - Canceled</p><p><br></p><p>DISPATCH_STATUS FOR SLS_BOOKING_DETAILS</p><p>0 - Not Dispatched</p><p>10 - Partially Dispatched</p><p>40 - Fully Dispatched</p><p><br></p><p><span style=\"font-size: 1rem;\">INV_STOCK FOR BOOKING_STATUS</span><br></p><p>0 - not booked</p><p>10 - Booked</p><p>20 - Expired(After Booking time)</p><p>30 - Extended</p><p>40 - Extended Expired(After Extention Period =&gt; booking cancel &amp; product free)</p><p>50 - Confirmed</p><p>60 - Payment Made/Reconfirmed</p><p>70 - Payment Verified</p><p>80 - Ordered</p><p>90 - Cancelled</p><p>100 - Booking Life Cycle Complete</p><p><br></p><p>SLS_COUPON_MASTER&nbsp;<br></p><p>COUPON_TYPE 1 = Percentage</p><p>&nbsp;COUPON_TYPE 2 = Amount</p><p><br></p><p>COUPON_ON</p><p><span style=\"background-color: rgb(247, 247, 249); color: rgb(33, 37, 41); font-family: SFMono-Regular, Menlo, Monaco, Consolas, &quot;Liberation Mono&quot;, &quot;Courier New&quot;, monospace; font-size: 12.25px;\">&lt;select class=\"form-control mb-1 select2\" data-validation-required-message=\"This field is required\" id=\"coupon_for\" required=\"\" name=\"coupon_for\"&gt;</span><br></p><pre>&lt;option value=\"1\"&gt;Product&lt;/option&gt;</pre><pre>&lt;option value=\"2\" selected=\"selected\"&gt;Master&lt;/option&gt;</pre><pre>&lt;option value=\"3\"&gt;Flat discount&lt;/option&gt;&lt;/select&gt;</pre><p><br></p><p><br></p><p><br></p><p><br></p><p>We are still processing your payment, please check your order later in My order.</p>\r\n </section>\r\n<section id=\"Loops_and_Iteration\">\r\n<h1> Loops_and_Iteration </h1>\r\n</section>\r\n  </main>\r\n  </div>',NULL),
('2',NULL,NULL);
