('34','How can I deactivate or delete my account?','Please keep the following in mind while requesting account deactivation or deletion: 1) Your account should not have any active orders or pending refunds. 2) Your account should not have any active installment plans. 3) You must not be a participant of any ongoing campaigns or rewards programs &     contests. 4) There should also be no active deposit or refund requests via AzuraMart. 6) Any existing vouchers and Coins in your account will be forfeited.','1','1',NULL,NULL,'2','2');
